import React from 'react';
import { ImageBackground,TouchableOpacity,StyleSheet, Text, View, TextInput, Alert } from 'react-native';

export default function App() {
  return (

    <View style={styles.container}>
      <ImageBackground style={styles.image} source={{uri:'https://i.imgur.com/ZE9SYaT.png'}}>
      <View style = {styles.content}>
        <TextInput style={styles.input}
        autoCapitalize='none'
        autoCorrect={false}
        clearTextOnFocus={false}
        keyboardAppearance='dark'
        keyboardType='number-pad'
        maxLength={8}
        placeholderTextColor='white'
        placeholder='Password'
        selectTextOnFocus={true}
        textAlign='center'
      >
        </TextInput>

        <TouchableOpacity style={styles.button}>
          <Text style={{fontSize:14}}>Sign</Text>
        </TouchableOpacity>
      </View>
     </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  image:{
    alignItems:'center',
    justifyContent:'center',
    width:'100%',
    height:'100%'
  },
  input:{
    alignItems:"center",
    justifyContent:'center',
    backgroundColor:'red',
    height:'7%',
    width:'100%',
    borderRadius:30,
    fontSize:22,
    fontWeight:"bold"

  },
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  content:{
    flex:1,
    height:'70%',
    width:'80%',
    alignItems:'center',
    justifyContent:'center'
  },
  button:
  {
    fontSize:18,
    marginTop:40,
    height:'7%',
    width:'100%',
    alignItems:'center',
    borderRadius:60,
    justifyContent:'center',
    backgroundColor:'green',
  }
});
